description:
Storyline

In Brooklyn, the bankrupted owner of a book store Fioravante is forced to close his family business. His best friend Murray tells him that his dermatologist Dr. Parker dreams of having a threesome and would pay a thousand dollars to have one with her friend Selima. Murray proposes to be Fioravante's pimp and they start a male prostitution business. When Fioravante meets the Jewish Avigal, who is the widow of a rabbi, they fall in love with each other. But the Jewish Dovi loves Avigal and will make life difficult for Murray.


